import React,{useState, useEffect, use} from "react";
import PartService from "../services/PartService";

const PartList = () => {
    const [parts, setParts] = useState([]);

    useEffect(() => {
        PartService.getAllParts()
            .then(response => {
                setParts(response.data);
            })
            .catch(error => {
                console.error("There was an error fetching the parts!", error);
            }); 
    }, []);
return (
  <div className="wc-table">
    <div className="wc-page-header">
      <h2 className="wc-page-title">Part List</h2>
      <div className="wc-actions">
        <button type="button" className="btn btn-sm btn-outline-primary">Create Part</button>
        <button type="button" className="btn btn-sm btn-outline-secondary">Export List</button>
      </div>
    </div>

    {parts.length === 0 ? (
      <div className="wc-empty">No parts yet. Click Create Part to add one.</div>
    ) : (
      <table className="table">
        <thead>
          <tr>
            <th>ID</th><th>Name</th><th>Version</th><th>State</th>
          </tr>
        </thead>
        <tbody>
          {parts.map(p => (
            <tr key={p.id}>
              <td>{p.partNumber}</td>
              <td>{p.name}</td>
              <td>{p.version}</td>
              <td>{p.lifecycleState}</td>
            </tr>
          ))}
        </tbody>
      </table>
    )}
  </div>
);


}
export default PartList;
